import React from 'react';
import { 
  Heading, 
  Paragraph, 
  Card, 
  Tag, 
  Link 
} from '@digdir/designsystemet-react';

interface SlackChannel {
  name: string;
  purpose: string;
  members: number;
  category: string;
}

const SlackChannels: React.FC = () => {
  const channels: SlackChannel[] = [
    {
      name: 'general',
      purpose: 'General discussions about Designsystemet',
      members: 450,
      category: 'Community'
    },
    {
      name: 'help',
      purpose: 'Get help with using Designsystemet',
      members: 380,
      category: 'Support'
    },
    {
      name: 'announcements',
      purpose: 'Important updates and announcements',
      members: 420,
      category: 'Updates'
    }
  ];

  const getCategoryColor = (category: string): "success" | "first" | "second" | "neutral" => {
    switch (category.toLowerCase()) {
      case 'community':
        return 'success';
      case 'support':
        return 'first';
      case 'updates':
        return 'second';
      default:
        return 'neutral';
    }
  };

  return (
    <div>
      <Heading level={1} size="xlarge" spacing>
        Slack Channels
      </Heading>
      <Paragraph spacing>
        Join our Slack channels to connect with the Designsystemet community, get help,
        and stay updated on the latest developments.
      </Paragraph>

      <Card>
        <div style={{ padding: '1rem' }}>
          <table style={{ width: '100%', borderCollapse: 'collapse' }}>
            <thead>
              <tr>
                <th style={{ textAlign: 'left', padding: '0.5rem' }}>Channel</th>
                <th style={{ textAlign: 'left', padding: '0.5rem' }}>Purpose</th>
                <th style={{ textAlign: 'left', padding: '0.5rem' }}>Members</th>
                <th style={{ textAlign: 'left', padding: '0.5rem' }}>Category</th>
              </tr>
            </thead>
            <tbody>
              {channels.map((channel) => (
                <tr key={channel.name}>
                  <td style={{ padding: '0.5rem' }}>
                    <Link href={`slack://channel?team=T0XXXXX&id=${channel.name}`}>
                      #{channel.name}
                    </Link>
                  </td>
                  <td style={{ padding: '0.5rem' }}>{channel.purpose}</td>
                  <td style={{ padding: '0.5rem' }}>{channel.members}</td>
                  <td style={{ padding: '0.5rem' }}>
                    <Tag
                      size="small"
                      color={getCategoryColor(channel.category)}
                    >
                      {channel.category}
                    </Tag>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </Card>

      <Card style={{ marginTop: '2rem' }}>
        <div style={{ padding: '1rem' }}>
          <Heading level={2} size="small" spacing>Channel Guidelines</Heading>
          <ul style={{ listStyle: 'none', padding: 0 }}>
            <li style={{ marginBottom: '1rem' }}>
              <Tag color="success" size="small">Best Practice</Tag>
              <Paragraph spacing style={{ marginTop: '0.5rem' }}>
                Keep discussions focused and on-topic for each channel.
              </Paragraph>
            </li>
            <li style={{ marginBottom: '1rem' }}>
              <Tag color="success" size="small">Best Practice</Tag>
              <Paragraph spacing style={{ marginTop: '0.5rem' }}>
                Use threads for detailed discussions to keep channels clean.
              </Paragraph>
            </li>
            <li style={{ marginBottom: '1rem' }}>
              <Tag color="success" size="small">Best Practice</Tag>
              <Paragraph spacing style={{ marginTop: '0.5rem' }}>
                Share code snippets using code blocks for better readability.
              </Paragraph>
            </li>
          </ul>
        </div>
      </Card>
    </div>
  );
};

export default SlackChannels;
